import React from "react";
import styled from "@emotion/styled";

const Style = styled.div`
  margin: 0 auto;
  max-width: 1280px;
  margin: 5rem;
  display: flex;
  align-items: center;
  flex-direction: column;
  justify-content: center;
`;

export default function CenterWrapper(props) {
  return <Style>{props.children}</Style>;
}
